/**
 * Enum that definitions the styles of how one element dock to another.
 * @name Dock
 * @enum {string} Dock
 */

/**
 * Align to the top left side of the target element.
 * value = 'top left'
 * @constant
 * @memberof Dock
 */
export const TOP_LEFT = 'top left';

/**
 * Align to the top center of the target element.
 * value = 'top center'
 * @constant
 * @memberof Dock
 */
export const TOP_CENTER = 'top center';

/**
 * Align to the top right of the target element.
 * value = 'top right'
 * @constant
 * @memberof Dock
 */
export const TOP_RIGHT = 'top right';

/**
 * Align to the bottom left of the target element.
 * value = 'bottom left'
 * @constant
 * @memberof Dock
 */
export const BOTTOM_LEFT = 'bottom left';

/**
 * Align to the bottom center of the target element.
 * value = 'bottom center'
 * @constant
 * @memberof Dock
 */
export const BOTTOM_CENTER = 'bottom center';

/**
 * Align to the bottom right of the target element.
 * value = 'bottom right'
 * @constant
 * @memberof Dock
 */
export const BOTTOM_RIGHT = 'bottom right';

/**
 * Align to the left top of the target element.
 * value = 'left top'
 * @constant
 * @memberof Dock
 */
export const LEFT_TOP = 'left top';

/**
 * Align to the left middle of the target element.
 * value = 'left middle'
 * @constant
 * @memberof Dock
 */
export const LEFT_MIDDLE = 'left middle';

/**
 * Align to the left bottom of the target element.
 * value = 'left bottom'
 * @constant
 * @memberof Dock
 */
export const LEFT_BOTTOM = 'left bottom';

/**
 * Align to the right top of the target element.
 * value = 'right top'
 * @constant
 * @memberof Dock
 */
export const RIGHT_TOP = 'right top';

/**
 * Align to the right middle of the target element.
 * value = 'right middle'
 * @constant
 * @memberof Dock
 */
export const RIGHT_MIDDLE = 'right middle';

/**
 * Align to the right bottom of the target element.
 * value = 'right bottom'
 * @constant
 * @memberof Dock
 */
export const RIGHT_BOTTOM = 'right bottom';
